import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import classnames from "classnames";

import { getUsers, deleteUser } from "../../actions/userActions";

import Users from "./Users";

class DashUsers extends Component {
    componentDidMount() {
        this.props.getUsers();
      }

    render() {
        const { users, usersLoading } = this.props.users;
        console.log(users)
        console.log(users.length)
        let dashboardContent;

        if (users === null || usersLoading) {
            dashboardContent = <p className="center-align">Loading...</p>;
          } else if (users.length > 0) {
            console.log("Entra acá")
            dashboardContent = <Users users={users} />;
          } else {
            dashboardContent = <p className="center-align">No hay usuarios</p>;
          }

        return (
            <div className="container">
                {dashboardContent}
            </div>
        )
    }
}

DashUsers.propTypes = {
    getUsers: PropTypes.func.isRequired,
    users: PropTypes.object.isRequired
}

const mapStateToProps = state => ({
    users: state.users
});

export  default connect(
    mapStateToProps,
    {getUsers}
) (DashUsers);
